import React, { useEffect } from "react";
import authMethods, { authorizationInfo } from "./AuthStore";
import { runInAction } from "mobx";

const RegisterToken = ({ match }) => {
  useEffect(() => {
    runInAction(() => {
      authMethods.setDefaultAxiosRequestHeader(match.params.token);
      authMethods.setUserInfo(match.params.token);
      authMethods.setAuthorizationInfo(true);
    });
    console.log(authorizationInfo.isAuthorized);
    window.location.href = "http://localhost:3000/";
  });
  return <div />;
};

export default RegisterToken;
